import{_ as o,c as a,a3 as t,o as s}from"./chunks/framework.JX9EV3OY.js";const h=JSON.parse('{"title":"Product FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"faq/product-faq.md","filePath":"faq/product-faq.md","lastUpdated":1732481377000}'),r={name:"faq/product-faq.md"};function d(i,e,n,c,l,u){return s(),a("div",null,e[0]||(e[0]=[t('<h1 id="product-faq" tabindex="-1">Product FAQ <a class="header-anchor" href="#product-faq" aria-label="Permalink to &quot;Product FAQ&quot;">​</a></h1><p>Welcome to the <code>RssTabs</code> FAQ page! Here are the frequently asked questions about our product that can help you better understand what we offer. If you can&#39;t find the answer you need, please get help through our <a href="./about/contact-us.html">Contact Us</a> page.</p><h2 id="what-is-rsstabs" tabindex="-1">What is RssTabs? <a class="header-anchor" href="#what-is-rsstabs" aria-label="Permalink to &quot;What is RssTabs?&quot;">​</a></h2><p><code>RssTabs</code> is an information aggregation platform based on <code>AI + RSS</code> technology, designed to help users efficiently manage feed sources, aggregate content, and optimize information acquisition experience through interesting features such as <code>AI</code> personalized recommendations, <code>AI</code> summaries, <code>AI</code> translation, and more.</p><p><a href="./../guide/introduction/what-is-it.html">Learn More</a></p><h2 id="what-is-a-single-feed" tabindex="-1">What is a Single Feed? <a class="header-anchor" href="#what-is-a-single-feed" aria-label="Permalink to &quot;What is a Single Feed?&quot;">​</a></h2><p>In <code>RssTabs</code>, we refer to conventional <code>RSS</code> feed sources as <code>Single Feed</code>.</p><p>A <code>Single Feed</code> is defined as a single, indivisible <code>RSS</code> feed source. In <code>RssTabs</code>, <code>Single Feed</code> is the basic unit for providing subscription and content management to users, serving as the foundation for <code>Poly Feed</code> data services.</p><p><a href="./../guide/introduction/single-feed.html">Learn More</a></p><h2 id="what-is-a-poly-feed" tabindex="-1">What is a Poly Feed? <a class="header-anchor" href="#what-is-a-poly-feed" aria-label="Permalink to &quot;What is a Poly Feed?&quot;">​</a></h2><p>In <code>RssTabs</code>, we refer to the aggregation of multiple <code>RSS</code> feed sources as a <code>Poly Feed</code>.</p><p>Using <code>RssTabs</code> to create a <code>Poly Feed</code>, you can select from thousands of <code>Single Feeds</code> we provide, or parse your own <code>RSS</code> subscription URLs into <code>Single Feeds</code>. Additionally, you can add keywords, tags, and other information, and we&#39;ll use <code>AI</code> to provide more granular and precise information.</p><p>You can also create a <code>Poly Feed</code> by parsing <code>OPML</code> files containing multiple <code>RSS</code> feed sources, or <code>OPML</code> files exported from other platforms.</p><p><a href="./../guide/introduction/poly-feed.html">Learn More</a></p><h2 id="how-to-use-rsstabs-properly" tabindex="-1">How to Use RssTabs Properly <a class="header-anchor" href="#how-to-use-rsstabs-properly" aria-label="Permalink to &quot;How to Use RssTabs Properly&quot;">​</a></h2><p>Before using <code>RssTabs</code>, you should carefully read this documentation to understand its features and usage methods.</p><p>We encourage users to create more <code>Poly Feeds</code> and share them publicly.</p><p>The rich content on the <code>RssTabs</code> platform depends on the participation of every user.</p><h2 id="the-future-of-rsstabs" tabindex="-1">The Future of RssTabs <a class="header-anchor" href="#the-future-of-rsstabs" aria-label="Permalink to &quot;The Future of RssTabs&quot;">​</a></h2><p>In the future, <code>RssTabs</code> will continue to improve and iterate to provide better services.</p><p>We will provide more powerful content recommendation algorithms, combining <code>AI</code> to deeply analyze user preferences. We will also continuously optimize support for aggregating more content types (such as images, videos, audio, etc.) to meet the needs of more users.</p><p>Additionally, we will develop community features, allowing users to share and follow <code>Poly Feeds</code>, as well as comment and like. This will provide more interaction opportunities for users, and in the future, you may even earn income by publishing <code>Poly Feeds</code>.</p><p><a href="./../guide/introduction/our-vision.html">Learn More</a></p>',23)]))}const f=o(r,[["render",d]]);export{h as __pageData,f as default};
